t me wrong, it sucks, but it's also providing wedding professionals the opportunity to work on their business instead of just in the business.⁣
⁣
Many wedding professionals I meet struggle to find the time to work on growing and marketing their businesses, and I get it, it’s a juggling act. You’re never going to get more than 24 hours in a day (sorry to be the bearer of bad news) so you have to actively make the time to work on your business.⁣
⁣
That means learning how to really focus on what matters, automate, delegate, and treat the time you set aside to work on your business like it's time you've set aside to meet with a client. You wouldn't bail on them so why bail on yourself?⁣
⁣
